import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Smartphone = createReactComponent("Smartphone", ["svg", defaultAttributes, [["rect", {
  x: "5",
  y: "2",
  width: "14",
  height: "20",
  rx: "2",
  ry: "2",
  key: "3bhjl3"
}], ["line", {
  x1: "12",
  y1: "18",
  x2: "12.01",
  y2: "18",
  key: "rbtten"
}]]]);
export default Smartphone;
